import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Home.css'; // Import the CSS file for styling

interface HomeProps {
    startGame: (playerNames: string[], courseInfo: CourseInfo | null) => void;
}

interface CourseInfo {
    name: string;
    par: number[]; // Array of pars for each hole
}

const Home: React.FC<HomeProps> = ({ startGame }) => {
    const [playerNames, setPlayerNames] = useState<string[]>(['']);
    const [courseQuery, setCourseQuery] = useState('');
    const [courseResults, setCourseResults] = useState<CourseInfo[]>([]);
    const [selectedCourse, setSelectedCourse] = useState<CourseInfo | null>(null);
    const navigate = useNavigate();

    const handleNameChange = (index: number, value: string) => {
        const updatedNames = [...playerNames];
        updatedNames[index] = value;
        setPlayerNames(updatedNames);
    };

    const addPlayer = () => {
        setPlayerNames([...playerNames, '']);
    };

    const handleStartGame = () => {
        const filteredNames = playerNames.filter((name) => name.trim() !== '');
        startGame(filteredNames, selectedCourse);
    };

    const searchCourses = async () => {
        try {
            console.log('Search button clicked, query:', courseQuery); // Debugging log

            const response = await fetch(`https://api.golfcourseapi.com/v1/search?search_query=${courseQuery}`, {
                headers: {
                    'Authorization': `Key ${process.env.REACT_APP_GOLF_API_KEY}`, // Use the environment variable
                },
            });

            if (!response.ok) {
                throw new Error(`API request failed with status ${response.status}`);
            }

            const data = await response.json();
            console.log('API response:', data); // Debugging log

            const courses = data.courses.map((course: any) => ({
                name: course.course_name || course.club_name, // Use course_name or fallback to club_name
                par: course.tees?.male?.[0]?.holes?.map((hole: any) => hole.par) || [], // Extract par values
            }));

            setCourseResults(courses);
            console.log('Course results updated:', courses); // Debugging log
        } catch (error) {
            console.error('Error fetching courses:', error);
        }
    };

    const handleCourseSelect = (course: CourseInfo) => {
        setSelectedCourse(course);
        setCourseQuery('');
        setCourseResults([]);
    };

    return (
        <div className="home-container">
            <h1>Welcome to the Golf Scorecard App</h1>
            <div className="player-inputs">
                {playerNames.map((name, index) => (
                    <div key={index} className="player-input">
                        <input
                            type="text"
                            placeholder={`Player ${index + 1}`}
                            value={name}
                            onChange={(e) => handleNameChange(index, e.target.value)}
                        />
                        {index === playerNames.length - 1 && (
                            <button onClick={addPlayer} className="add-player-button">
                                Add Player
                            </button>
                        )}
                    </div>
                ))}

                {/* Golf Course Search Section */}
                <div className="course-search">
                    <h3>Select Golf Course</h3>
                    <input
                        type="text"
                        placeholder="Search for a course"
                        value={courseQuery}
                        onChange={(e) => setCourseQuery(e.target.value)}
                    />
                    <button onClick={searchCourses} className="search-course-button">
                        Search
                    </button>

                    {/* Display Search Results */}
                    {courseResults.length > 0 && (
                        <ul className="course-results">
                            {courseResults.map((course, index) => (
                                <li key={index} onClick={() => handleCourseSelect(course)}>
                                    {course.name}
                                </li>
                            ))}
                        </ul>
                    )}

                    {/* Display Selected Course */}
                    {selectedCourse && (
                        <div className="selected-course">
                            <h4>Selected Course: {selectedCourse.name}</h4>
                            <p>Par for each hole: {selectedCourse.par.join(', ')}</p>
                        </div>
                    )}
                </div>
            </div>

            <button onClick={handleStartGame} className="start-game-button">
                Start Game
            </button>
        </div>
    );
};

export default Home;
